Desi can cover a total of 18 miles in six hours.

First, determine the time spent on each activity. Running time is 2 hours (1/3 of 6), and walking time is 4 hours (2/3 of 6). Next, find running speed: since jumping (3 mph) is half of running, the running speed is 6 mph. Walking speed is 6/4 = 1.5 mph. Calculate distances: 6 mph *2 = 12 miles running, and 1.5 mph *4 =6 miles walking. Total distance is 12 +6 =18 miles.

\boxed{18}

