The total points Akbar scored in the 40-minute game is calculated by adding the points from both halves. He scored 4 points in the first 20 minutes and 25% more in the next 20 minutes. 

Calculating 25% of 4 gives 1, so the second half adds 1 point to the initial 4, totaling 5 points. Adding both halves together, 4 + 5 equals 9 points.

