A single candle burns at a rate of 2 centimeters per hour. To find out how much it burns from 13:00 to 17:00, which is a total of 4 hours, we multiply the burning rate by the time:

\[
2 \, \text{cm/hour} \times 4 \, \text{hours} = 8 \, \text{cm}
\]

**Answer:** \boxed{8}

Bagas drives a total of 60 miles each week, spread over 3 days. He drove 3 hours on one day and 1.5 hours on each of the other two days. This totals 6 hours of driving time. Dividing the total distance by the total time gives a speed of 10 miles per hour.

Speed = 60 miles / 6 hours = 10 mph.

**Answer:** \boxed{10}

